import React, { useState } from "react";
import { InputText } from "primereact/inputtext";
import { FloatLabel } from "primereact/floatlabel";

export default function Inputfds() {
    const [value, setValue] = useState<string>('');

    return (
        <div className="card flex justify-content-center" style={{flexDirection:"column", gap:20, paddingTop:10}}>
            <FloatLabel style={{gap:10}}>
                <InputText id="mobilenumber" value={value} onChange={(e: React.ChangeEvent<HTMLInputElement>) => setValue(e.target.value)} />
                <label htmlFor="mobilenumber">Mobile Number</label>
            </FloatLabel>
            <FloatLabel style={{gap:10}}>
                <InputText id="mobilenumber" value={value} onChange={(e: React.ChangeEvent<HTMLInputElement>) => setValue(e.target.value)} />
                <label htmlFor="mobilenumber">Amount</label>
            </FloatLabel>

        </div>
    )
}
